import React from "react";

function Videos() {
  return (
    <div>
      <iframe width="560" height="315" src="https://www.youtube.com/embed/mSWn3OR_jWs?si=Xcg7cGg-SX3M32Pe" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
      </div>

  )
}

export default Videos;
